import React from 'react';

class MainMenu extends React.Component {
  render() {
    return (
      <nav className='menuPrincipal-nav'>
        <ul>
          <li><h2>Home</h2></li>
          <li><h2>Produtos</h2></li>
          <li><h2>Carrinho</h2></li>
          <li><h2>Contato</h2></li>
        </ul>
      </nav>
    );
  }
}

export default MainMenu;
